visit the Lamborghini Automobile plant. Rides will receive never-before-allowed access to the plant, witnessing the creation of a hand-crafted Gallardo, as well as the first ever Murcielago roadster. We will witness the craftsmanship that makes these cars the hottest and most exotic toys in the super car industry.

We\&amp;#039;ll also take these beautiful beasts for a test drive on the official test track of Lamborghini, the two-lane highway in front of the plant. The official test driver, Valentino Balboni, has been there for 35 years, through 5 changes in ownership, probably the most impressive track record of all!

